This is my MongoStore and Express session configuration:</p>
<pre><code>const MongoStore = require('connect-mongo');
const mongoStore = MongoStore.create({
    mongoUrl: urlDBLocale,
    crypto: { // this parameter causes &quot;Unable to parse ciphertext object&quot; in Chrome
        secret: process.env.mdbssecret,
    },
    touchAfter: 24 * 3600
});
mongoStore.on(&quot;error&quot;, err=&gt;console.log('MongoDB Session Storage error:', err));
const sessionOptions = {
    cookie: {
        httpOnly: true, 
        secure: false, 
        maxAge: 3600000 
    },
    name:  'whatever', 
    saveUninitialized: false,
    secret: process.env.sessionSecret,
    store: mongoStore,
    resave: false
};
