Nodejs MongoDb add column to query that is a count of specific records<p>Considering the following document structure:</p>
<pre><code>{_id: 1, name: 'joe', snapshot: null, age: 30}
{_id: 2, name: 'joe', snapshot: 'snapshot1', age: 30}
{_id: 3, name: 'joe', snapshot: 'snapshot15', age: 30}
{_id: 4, name: 'joe', snapshot: 'snapshot23', age: 30}
</code></pre>
<p>How would I perform a query that groups on the name field and adds an additional field that is a count of the remaining records containing subtree: 'additionalinfo'. It would look like this:</p>
<pre><code>{_id: 1, name: 'joe', snapcount: 3, age: 30}
</code></pre>
<p>I've been able to group using aggregations but I can't quite get it like this.</p>
<p>My own solution:</p>
<p>I ultimately restructured my data to look like this instead:</p>
<pre><code>{
  _id: 1, 
  name: 'joe', 
  snapshots: [
    {name: 'snap17', id: 1},
    {name: 'snap15', id: 2},
    {name: 'snap14', id: 3}
  ], 
  age: 30
}
</code></pre>
<p>This allows me to just check snapshots.length to solve my original problem. However; the answers in this post where very helpful and answered the original question.</p>

