What is the fastest way to decode a nested MongoDB document array into a struct slice in Go?<p>Here's my problem. I'm using gqlgen library to run a GraphQL server. In my database I have a MongoDB document that looks like this:</p>
<pre><code>{
  &quot;_id&quot;: ObjectID(...),
  &quot;somefield&quot;: &quot;data&quot;,
  &quot;anArrayOfObjects&quot;: [
    {
      &quot;field1&quot;: &quot;value1&quot;,
      &quot;field2&quot;: &quot;value2
    },
    ...
  ]
}
</code></pre>
<p>What I want is to be able to only decode the field <code>anArrayOfObjects</code> into a slice (may look like <code>[]MyObj</code>, where <code>MyObj</code> is a struct).</p>
<p>(For a little context, I only want this field because the array is quite large and it has it's own GraphQL resolver).</p>
<p>Here's currently what I have tried:</p>
<pre><code>ObjectID, err := primitive.ObjectIDFromHex(&quot;someid&quot;)
// do some error check

opts := options.FindOne().SetProjection(
    bson.D{{Key: &quot;anArrayOfObjects&quot;, Value: 1}, {Key: &quot;_id&quot;, Value: 0}},
)
myslice = []MyObj{}
err := coll.FindOne(ctx, bson.M{&quot;_id&quot;: ObjectID}, opts).Decode(&amp;myslice)
// err is &quot;cannot decode document into []MyObj&quot;
</code></pre>
<p>If instead I run</p>
<pre><code>result = primitive.D{} // or primitive.M{}
err := coll.FindOne(ctx, bson.M{&quot;_id&quot;: ObjectID}, opts).Decode(&amp;result)
// err is nil and result contains everything I want but not in the &quot;ideal&quot; data structure
</code></pre>
<p>Doing the latter, I reckon I can iterate through <code>result</code> and then map everything to every struct field (similar to <a href="https://stackoverflow.com/a/66769231/14893173">this answer</a>). But my intuition is that probably there is a better way to do this than that.</p>
<p>Thanks in advance!</p>

